import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Landing extends React.Component {
    render(){
        return (
            <div style={{width: '100%', margin:'auto'}} >
                <Grid className="landing-grid">
                    <Cell col={12}>
                    <img src="https://www.google.com/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwiJy7GvveLhAhWGb30KHbrOBx0QjRx6BAgBEAU&url=https%3A%2F%2Fwww.iconfinder.com%2Ficons%2F628284%2Favatar_male_man_mature_old_person_user_icon&psig=AOvVaw3NJPXqRlOKRJf4IiN4EPlo&ust=1555980533892687" alt=""/>
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Landing;
